import React from 'react';
import { Link } from 'react-router-dom';
function Header() {
  return (
    <div>
      <header className="head">
        <img src="budget_logo.jpg" alt="PB Logo" />
        <h3>PB Tracker </h3>
      </header>
      <Link itemProp="url" to="/signup">
              <button className='menu-btn'>Signup</button>
            </Link>
    </div>
  );
}

export default Header;
